import React from "react";
import "./heading.css";

function Heading() {
  return (
    <>
      <div id="heading">
        <span id="span1">EB</span>
        <div id="span2">
          <p id="span2-1">ELITE</p>
          <p id="span2-2">BANARAS</p>
        </div>
      </div>
    </>
  );
}

export default Heading;
